member.summary:
Situação da Manifestação do Destinatário:
0=Sem Manifestação do Destinatário;
1=Confirmada Operação;
2=Desconhecida;
3=Operação não Realizada;
4=Ciência.
Esta propriedade só terá conteúdo no retorno da consulta com o schema versão 1.35. Na versão 1.01 a SEFAZ não retorna esta tag.

member.example:
Exemplos de conteúdo:

   application/soap+xml; charset=utf-8;
   text/xml; charset=utf-8;

Deixe o conteúdo em brando para utilizar um valor padrão.

//Detectar os dados de conexão do proxy automaticamente
DefinirProxy(true);

//Passar os dados do proxy para conexão manualmente
DefinirProxy(false, "user", "pass");

try
{
    XMLUtility.ChecarChaveDFe("41201280568835000181570010000004841004185096");
}
catch(Exception ex)
{
    //Se chave tiver algum erro, vai retornar uma exceção.
    MessageBox.Show(ex.Message);
}

var texto = " Eu    vou   ao    supermercado comprar alimentos.    ";
texto = XMLUtility.LimparEspacoDesnecessario(texto);
MessageBox.Show(texto); // Retorno será: "Eu vou ao supermercado comprar alimentos."

member.summary:
Tratar caracteres especiais existentes na string substituindo por escape.
Caracteres substituídos:   & < > \ ' 
Escapes utilizados:   &amp; &lt; &gt; &quot; &#39;

member.example:
var texto = "Dias \ Dias";
texto = XMLUtility.TratarCaracterEspecial(texto);
MessageBox.Show(texto); // Retorno será: "Dias " Dias"

//Validar arquivos de NFe
Validar(xmlDocument, "NFe.consStatServCTe_v3.00.xsd")

//Validar arquivos de CTe
Validar(xmlDocument, "CTe.consStatServCTe_v3.00.xsd")

//Validar arquivos de MDFe
Validar(xmlDocument, "MDFe.consStatServ_v4.00.xsd")
